/** 
 * Get Spot Trade Pair List
 * METHOD: GET
 * URL : /api/spot/tradePair
*/
export const getPairList = async (req, res) => {
    try {
        let spotPairData = await SpotPair.aggregate([
            { "$match": { "status": "active" } },
            {
                "$lookup":
                {
                    "from": 'currency',
                    "localField": "firstCurrencyId",
                    "foreignField": "_id",
                    "as": "firstCurrencyInfo"
                }
            },
            { "$unwind": "$firstCurrencyInfo" },

            {
                "$lookup":
                {
                    "from": 'currency',
                    "localField": "secondCurrencyId",
                    "foreignField": "_id",
                    "as": "secondCurrencyInfo"
                }
            },
            { "$unwind": "$secondCurrencyInfo" },
            {
                "$project": {
                    '_id': 1,
                    'firstCurrencyId': 1,
                    'firstCurrencySymbol': 1,
                    'firstCurrencyImage': {
                        "$cond": [
                            { "$eq": ['$firstCurrencyInfo.image', ''] },
                            "",
                            { "$concat": [config.SERVER_URL, config.IMAGE.CURRENCY_URL_PATH, "$firstCurrencyInfo.image"] }
                        ]
                    },

                    'secondCurrencyId': 1,
                    'secondCurrencySymbol': 1,
                    'secondCurrencyImage': {
                        "$cond": [
                            { "$eq": ['$secondCurrencyInfo.image', ''] },
                            "",
                            { "$concat": [config.SERVER_URL, config.IMAGE.CURRENCY_URL_PATH, "$secondCurrencyInfo.image"] }
                        ]
                    },
                    'firstFloatDigit': 1,
                    'secondFloatDigit': 1,
                    'botstatus': 1,

                    'last': 1,
                    'markPrice': 1,
                    'low': 1,
                    'high': 1,
                    'firstVolume': 1,
                    'secondVolume': 1,
                    'changePrice': 1,
                    'change': 1,
                }
            },
        ])
        return res.status(200).json(encodedata({ 'success': true, 'messages': "success", 'result': spotPairData }))
    } catch (err) {
        return res.status(500).json(encodedata({ 'status': false, 'message': "Error occured" }))
    }
}

