export const assetUpdate = async ({
    currencyId,
    userId,
    balance,
    tableId = "",
    type = "",
    category = "",
}) => {
    try {
        let walletData = await Wallet.findOne({
            '_id': userId,
        })
        if (walletData) {
            let usrAsset = walletData.assets.id(currencyId)
            if (usrAsset) {
                let beforeBalance = parseFloat(usrAsset.spotBal);

                console.log("-----usrAsset----balance", usrAsset.spotBal, balance)
                usrAsset.spotBal = usrAsset.spotBal + parseFloat(balance);
                await walletData.save();
                let passbookData = {};
                passbookData.userId = walletData._id;
                passbookData.coin = usrAsset.coin;
                passbookData.currencyId = usrAsset._id;
                passbookData.tableId = tableId;
                passbookData.beforeBalance = beforeBalance;
                passbookData.afterBalance = parseFloat(usrAsset.spotBal);
                passbookData.amount = parseFloat(balance);
                passbookData.type = type;
                passbookData.category = "credit";

                let passbook = createPassBook(passbookData);


                socketEmitOne('updateTradeAsset', {
                    'currencyId': usrAsset._id,
                    'spotBal': usrAsset.spotBal,
                    'derivativeBal': usrAsset.derivativeBal,
                }, userId)

                return {
                    'status': true,
                    'beforeBalance': beforeBalance,
                    'afterBalance': parseFloat(usrAsset.spotBal),
                    'amount': parseFloat(balance)
                }
                return passbook;
            }
        }
    } catch (err) {
        console.log("-----err", err)
    }
}

